import React from 'react';
import Grid from '@material-ui/core/Grid';
import Icon from '@material-ui/core/Icon';
import Button from '@material-ui/core/Button';

export function TagsSections() {
  return (
    <Grid 
      container
      alignItems='center' 
      justifyContent='center'
      className='tags-container'  
    >
      <Grid item xs={6} sm={6} align='left'>
        <Icon className='search-icons'>star</Icon>
        <Icon className='search-icons'>book</Icon>
        <Icon className='search-icons'>bookmarks</Icon>
        <Icon className='search-icons'>nightlight_round</Icon>
        <Icon className='search-icons'>anchor</Icon>
        <Icon className='search-icons'>outlet</Icon>
        <Icon className='search-icons'>school</Icon>
        <Icon className='search-icons'>deck</Icon>
      </Grid>
      <Grid item xs={4} sm={4} align='right'>
        <Button variant="contained" color='primary' className='search-button'>
          Primary
        </Button> 
      </Grid>
    </Grid>
  );
};
